import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Step 1: Add an item to the cart to set up the test state
    await page.evaluate(() => {
      // This function is available in the page's context from script.js
      addToCart(1); 
    });

    // Step 2: Click the cart icon to open the cart modal
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.locator('div.cart').click();

    // Step 3: Wait for the cart modal and the item to be visible
    await page.waitForSelector('.cart-item', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_with_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_with_item.png'));

    // Step 4: Click the "Remove" button for the item in the cart
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    await page.locator('.remove-item').click();

    // Step 5: Wait for the "empty cart" message to appear
    await page.waitForSelector('.empty-cart', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_empty.png'));

    // Step 6: Extract data to verify the cart is empty
    const emptyCartText = await page.locator('.empty-cart').textContent();
    const cartCount = await page.locator('#cartCount').textContent();

    return {
      success: true,
      action: "Successfully removed an item from the cart.",
      extractedData: {
        emptyCartMessage: emptyCartText,
        finalCartItemCount: parseInt(cartCount, 10)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Capture a screenshot on failure
    const errorScreenshots = [];
    try {
        const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
        await page.screenshot({ path: errorScreenshotPath });
        errorScreenshots.push(errorScreenshotPath);
    } catch (e) {
        console.error("Failed to take error screenshot:", e);
    }

    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: errorScreenshots,
      error: error.message
    };
  }
}
